    .set('Accept', 'application/json')
    .set('Authorization', 'Basic dmFpc2huYXZpLmphd2FuamFsQGN1ZWxvZ2ljLmNvbTo3NmNVSXByaXVDaDlpTm1jZHJXZTA3RDQ=')
    .end((err, res) => {
                      if (err) { return console.log("error : ",err); }
                      console.log("url 2 ");
                      console.log("res",res.body);
                     return res.body;
    })

